#include<bits/stdc++.h>
using namespace std;
#define ll long long
class Solution {
public:
    long long maximumValueSum(vector<vector<int>>& g) {
        ll ans=-1e10,m=g.size(),n=g[0].size(); vector<vector<ll>> v;
        for(int i=0;i<m;i++){
            for(int j=0;j<n;j++) v.push_back({g[i][j],i,j});
        }
        sort(v.begin(),v.end()); 
        int i=max(0,int(v.size()-308));
        for(;i<v.size();i++){
            for(int j=i+1;j<v.size();j++){
                for(int k=j+1;k<v.size();k++){
                    ll i1=v[i][1],i2=v[j][1],i3=v[k][1]; ll j1=v[i][2],j2=v[j][2],j3=v[k][2];
                    // cout<<i1<<" "<<i2<<" "<<i3<<endl;
                    if(i1==i2 || i2==i3 || i3==i1 || j1==j2 || j2==j3 || j3==j1) continue;
                    ll tans=v[i][0]+v[j][0]+v[k][0];
                    // cout<<tans<<endl;
                    ans=max(ans,tans);
                }
            }
        }
        return ans;
    }
};
